import React from 'react'

class Admin extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            data:{
                labels:['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday','Sunday'],
                dataSets:[{
                    label:'Population',
                    data:[3213123,3123123,312312,5,125512]
                }]
            }
        }
    }
}

export default Admin
